`Uthman bin Hunaif narrated that a blind man came to the Prophet () and said:

Supplicate to Allah to heal me. He () said: If you wish I will supplicate for you, and if you wish, you can be patient, for that is better for you. He said: Then supplicate to Him. He said: So he ordered him to perform Wudu and to make his Wudu complete, and to supplicate with this supplication: O Allah, I ask You and turn towards You by Your Prophet Muhammad (), the Prophet of Mercy. Indeed, I have turned to my Lord, by means of You, concerning this need of mine, so that it can be resolved, so O Allah so accept his intercession for me (Allhumma inn asaluka wa atawajjahu ilaika binabiyyka Muammadin nabi-ir-ramati, inn tawajjahtu bika ila rabb f jat hdhih lituq l, Allhumma fashaffi`hu fyya).. .

